        "/package.json": "{\n  \"name\": \"hypertool-logo\",\n  \"description\": \"Hyper Tool Text\",\n  \"version\": \"0.1.0\",\n  \"type\": \"module\",\n  \"scripts\": {\n    \"dev\": \"vite --port 3000 --host 0.0.0.0\",\n    \"build\": \"vite build\",\n    \"preview\": \"vite preview\"\n  },\n  \"dependencies\": {},\n  \"devDependencies\": {\n    \"vite\": \"^5.0.0\",\n    \"typescript\": \"^5.3.3\"\n  }\n}",
